import React from "react";
import axios from 'axios';

const getBirthday = async()=>{
 try {
    const{data} =await axios.get(`${process.env.URL_SERVER}/api/getBirthday`);
    return data.data
 } catch (error) {
     console.log(error)
 }
} 
console.log(getBirthday);
export default function Birthday() {
    return(
        <div>Birthday</div>
    )
}
